"use strict";(self.webpackChunkmy_docusaurus_website=self.webpackChunkmy_docusaurus_website||[]).push([[8130],{7735:a=>{a.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/2024/07/23/integrasi-adminlte-yii2","metadata":{"permalink":"/blog/2024/07/23/integrasi-adminlte-yii2","editUrl":"https://github.com/khanifzyen/my-docusaurus-website/tree/master/blog/2024-07-23-integrasi-adminlte-yii2.md","source":"@site/blog/2024-07-23-integrasi-adminlte-yii2.md","title":"Integrasi AdminLte dengan Yii2","description":"Adminlte terbaru berlokasi di https://github.com/ColorlibHQ/AdminLTE, saat ini versi 4.0.0-beta1. Sudah menggunakan Bootstrap 5, dan yii2 secara default juga menggunakan bootstrap 5, sehingga seharusnya bisa seamless.","date":"2024-07-23T00:00:00.000Z","tags":[{"inline":false,"label":"yii2","permalink":"/blog/tags/yii2","description":"Yii2 related"}],"readingTime":0.885,"hasTruncateMarker":true,"authors":[{"name":"Akhmad Khanif Zyen","title":"Sofware Developer dan Dosen UNISNU Jepara","url":"https://id.linkedin.com/in/khanifzyen","imageURL":"https://media.licdn.com/dms/image/D5603AQGpesMklgDCiQ/profile-displayphoto-shrink_200_200/0/1719824233948?e=2147483647&v=beta&t=VoX5h1iuFi1CfQJNVu5jGgEazIgniZSn-YddUYDx35k","key":"khanifzyen"}],"frontMatter":{"authors":"khanifzyen","tags":["yii2"]},"unlisted":false,"nextItem":{"title":"Blog Pertama!","permalink":"/blog/2024/07/13/blog-pertama"}},"content":"Adminlte terbaru berlokasi di https://github.com/ColorlibHQ/AdminLTE, saat ini versi 4.0.0-beta1. Sudah menggunakan Bootstrap 5, dan yii2 secara default juga menggunakan bootstrap 5, sehingga seharusnya bisa _seamless_.\\r\\n\\r\\n## 1. Install node dan git\\r\\n\\r\\nLangkah pertama adalah pastikan node sudah terinstall di komputer lokal, gunakan versi 20 karena LTS. Unduh node [disini](https://nodejs.org/en/download/prebuilt-installer/current). Jika sudah jalankan perintah `node -v`\\r\\n\\r\\n```bash\\r\\nC:\\\\Users\\\\User>node -v\\r\\nv20.15.1\\r\\n```\\r\\n\\r\\nBerikutnya pastikan git sudah terinstal di komputer lokal. Unduh git [disini](https://git-scm.com/downloads). Jika sudah jalankan perintah `git -v`\\r\\n\\r\\n```bash\\r\\nC:\\\\Users\\\\User>git -v\\r\\ngit version 2.42.0.windows.2\\r\\n```\\r\\n\\r\\n\x3c!-- truncate --\x3e\\r\\n\\r\\n## 2. Clone project AdminLte dan build production\\r\\n\\r\\nDownload project dari repository AdminLTE melalui perintah `git clone`, misal kita akan menjalankan di folder `d:\\\\khanif`\\r\\n\\r\\n```bash\\r\\nC:\\\\Users\\\\User>d:\\r\\n\\r\\nD:\\\\>cd khanif\\r\\n\\r\\nD:\\\\khanif>git clone https://github.com/ColorlibHQ/AdminLTE.git\\r\\n```\\r\\n\\r\\nSelanjutnya anda menjalankan `npm install` untuk menginstal dependency yang diperlukan dan run production\\r\\n\\r\\n```bash\\r\\nD:\\\\khanif>cd AdminLTE\\r\\n\\r\\nD:\\\\khanif\\\\AdminLTE>npm install\\r\\n\\r\\nD:\\\\khanif\\\\AdminLTE>npm run production\\r\\n```\\r\\n\\r\\nSelanjutnya akan terbentuk folder `dist` yang berisi demo page hasil compile dari typescript dan SCSS ke javascript dan CSS biasa. Nanti file `adminlte.min.js` dan `adminlte.min.css` yang akan kita masukkan ke dalam Asset Bundle di dalam yii2."},{"id":"/2024/07/13/blog-pertama","metadata":{"permalink":"/blog/2024/07/13/blog-pertama","editUrl":"https://github.com/khanifzyen/my-docusaurus-website/tree/master/blog/2024-07-13-blog-pertama.md","source":"@site/blog/2024-07-13-blog-pertama.md","title":"Blog Pertama!","description":"Hari pertama menggunakan docusaurus. Kesimpulannya sangat user friendly, materi kuliah yang sebelumnya sudah dibuat dari markdown terus langsung taruh di github. Kenapa ga dipakai dari dulu ya? Ini nanti juga diplublish di github pages. Sementara membiasakan dulu untuk menulis.","date":"2024-07-13T00:00:00.000Z","tags":[{"inline":false,"label":"Unisnu","permalink":"/blog/tags/unisnu","description":"Unisnu related"}],"readingTime":0.195,"hasTruncateMarker":false,"authors":[{"name":"Akhmad Khanif Zyen","title":"Sofware Developer dan Dosen UNISNU Jepara","url":"https://id.linkedin.com/in/khanifzyen","imageURL":"https://media.licdn.com/dms/image/D5603AQGpesMklgDCiQ/profile-displayphoto-shrink_200_200/0/1719824233948?e=2147483647&v=beta&t=VoX5h1iuFi1CfQJNVu5jGgEazIgniZSn-YddUYDx35k","key":"khanifzyen"}],"frontMatter":{"authors":"khanifzyen","tags":["unisnu"]},"unlisted":false,"prevItem":{"title":"Integrasi AdminLte dengan Yii2","permalink":"/blog/2024/07/23/integrasi-adminlte-yii2"}},"content":"Hari pertama menggunakan docusaurus. Kesimpulannya sangat user friendly, materi kuliah yang sebelumnya sudah dibuat dari markdown terus langsung taruh di github. Kenapa ga dipakai dari dulu ya? Ini nanti juga diplublish di github pages. Sementara membiasakan dulu untuk menulis."}]}}')}}]);